043168524049", "product_classification"=>{"product_type_name"=>"GARAGE & HARDWARE"}, "product_description"=>{"title"=>"General Electric Full Color Smart LED Bulb A19", "downstream_description"=>"Use Full Color Smart Bulb to change the vibe of any space in seconds. Use millions of colors to change a kids' room with their interests, to create a next level movie night, and support your team on game day. The tunable white spectrum supports your sleep/wake cycle and creates the perfect scene for winding down or waking up. Get added confidence by scheduling your lights so you never coming home to a dark house. With voice control and the ability to control your lights away from home, you'll get the added convenience of controlling your lights while away on vacation or when your hands are full. ", "bullet_descriptions"=>["<B>Overall Length:</B> 2.44 Inches", "<B>Bulb Base Size:</B> Standard Edison Medium Screw Base E26", "<B>Light Appearance:</B> Color Temperature Varies", "<B>Lumens:</B> 800", "<B>Bulb Life:</B> 13.7 Years", "<B>Recommended Use:</B> General Purpose", "<B>Package Quantity:</B> 1", "<B>Light Bulb Color:</B> Multicolored", "<B>Light Bulb Type:</B> LED", "<B>Industry or Government Certifications:</B> No Certifications", "<B>Federal Efficiency Standards:</B> Yes", "<B>Watt output equivalent:</B> 60 Watts", "<B>Volts Required:</B> 120 Volts", "<B>Contains mercury:</B> No", "<B>California Title 20 compliance:</B> CA Title 20 compliant", "<B>Light bulb shape:</B> A19", "<B>Color rendering index:</B> 90", "<B>Light settings:</B> Dimmable (Full Range)", "<B>Energy used (watts):</B> 9.5", "<B>Power factor rating:</B> .9", "<B>Warranty:</B> 3 Year Limited Warranty. To obtain a copy of the manufacturer's or supplier's warranty for this item prior to purchasing the item, please call Target Guest Services at 1-800-591-3869"], "soft_bullets"=>{"title"=>"highlights", "bullets"=>["Simple set up without a hub: Control the Full Color Light Bulb using the Cync app with no addi